function initMap(){var n=document.querySelectorAll(".js-map");Array.prototype.forEach.call(n,function(n){var t=+n.dataset.latitude,i=+n.dataset.longitude,r=+n.dataset.zoom,u,f;t!==""&&i!==""&&r>0&&(u=new google.maps.Map(n,{zoom:r,center:{lat:t,lng:i},disableDefaultUI:!1}),f=new google.maps.Marker({map:u,animation:google.maps.Animation.DROP,position:{lat:t,lng:i}}))})}